import React,{Component} from 'react'
import { View, 
    Text, 
    TouchableOpacity, 
    Dimensions,
    StyleSheet,
    Image,
    ImageBackground,
} from 'react-native';
import {LinearGradient} from 'expo-linear-gradient';
import MaterialIcons from 'react-native-vector-icons/MaterialIcons';
import {
    widthPercentageToDP as wp,
    heightPercentageToDP as hp,
    listenOrientationChange as loc,
    removeOrientationListener as rol
} from 'react-native-responsive-screen';
import AntDesign from 'react-native-vector-icons/AntDesign';
import {FontAwesome5} from '@expo/vector-icons';
import Langue2 from './Langue2';

console.disableYellowBox = true;

const LoadingScene=(props) =>{
    return (
        <View style={styles.container}>
            <View  styles={{width:wp('100%'),height:hp('100%'),justifyContent: 'center',flexDirection: 'column' }}>
                <View style={styles.containerr} >
                    <View>
                        <Image
                            style={styles.headerrr}
                            source={require('../images/green.png')}
                            resizeMode="stretch"
                        />
                        <Langue2 />  
                    </View>
                </View> 
                <View style={styles.header}>
                    <Image
                    source={require('../images/loogo.png')}
                    />
                    <Text style={styles.title}>SMART IRRIGATION</Text>
                    <Text style={styles.title}> APP</Text>
                </View>
                <View style={styles.containerrr}>
                    <Image  source={require('../images/blue.png')}
                        style={styles.image}  
                    />
                    <View style={styles.button}>
                        <TouchableOpacity onPress={()=>props.navigation.navigate('Login')}>
                            <LinearGradient
                                colors={['#56CCF2', '#2F80ED']}
                                style={styles.signIn}
                            >
                                <Text style={styles.textSign}>S'identifier</Text>
                            </LinearGradient>
                        </TouchableOpacity>
                        <Image  style={styles.yobeen} source={require('../images/yobeen.png')}/>
                    </View>
                </View>
            </View>
        </View>
    );
};

export default LoadingScene;

const {height} = Dimensions.get("screen");
const height_logo = height * 0.28;
const styles = StyleSheet.create({
    container: {
        flex: 1, 
        backgroundColor: '#fff',
        //alignItems: 'center',
        justifyContent: 'center',
    },

    containerr: {
        width:wp('100%'),
        height:hp('25%'),
        marginLeft:wp('1%')
        //marginTop:29
    },
  
    containerrr: {
        width:wp('100%'),
        height:hp('40%')
        //marginTop:29
     },

    yobeen:{
        marginLeft:wp("69%") ,
        marginTop:hp("12%")  
    },
 
    header: {
        width: wp('100%'),
        height: hp('40%'),
        justifyContent: 'center',
        alignItems: 'center',
    },

    footer: {
        flex: 1,
        backgroundColor: '#D3E9F7',
        borderBottomLeftRadius:86,
        borderTopRightRadius:100,
        paddingVertical: 50,
        paddingHorizontal: 30
    },

    image: {
        position:'absolute',
        marginTop:hp("4%")
    },

    haut:{
        position:'relative'
    },

    logo: {
        width: height_logo,
        height: height_logo,
    },

    headerrr:{
        width:wp('100%'),
        //height:hp('5%')
    },

    green: {
        flex: 1,
        resizeMode: "cover",
        justifyContent: "center",
        marginLeft:20,
    },

    title: {
        color: '#05375a',
        fontSize: wp('8%'),
        fontWeight: 'bold',
        //fontFamily:'Roboto-Black',
    },

    text: {
        color: '#0c7801',
        marginTop:5,
        fontWeight: 'bold',
    },

    signIn: {
        width:wp("45%"),
        height:hp('5%'),
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 14, //50
        flexDirection: 'row',
        //marginBottom:"6%",
    },

    signIn2: {
        width: 180,
        height: 40,
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 14, //50
        flexDirection: 'row',
    },

    textSign: {
        color: 'white',
        fontWeight: 'bold',
        fontSize:wp("4.5%")
    },

    button: {
        alignItems: 'center', //flex-end
        marginTop: hp("14%") //30
    },
});

